import React from "react";
import Container from "../components/Container";

const HomePage = () => {
    return (
        <Container className="container centered-container">
            <Container className="row">
                <Container className="col-lg-6 col-sm-12"/>
                <Container className="col-lg-6 col-sm-12"/>
            </Container>
        </Container>
        
    );
};

export default HomePage;
